import React, { useState } from "react";
import styled from "styled-components";
import {
  HorizontalWrapper,
  VerticalWrapper,
} from "./reusable/styled-components";

import ArboretumCreekLogo from "../images/ArboretumCreekLogo.png";
import Chip from "./reusable/Chip";
import SelectedWorkContent from "./SelectedWorkContent";
import { useEffect } from "react";

const Work = () => {
  const [selectedWork, setSelectedWork] = useState<number>(0);
  const [loading, setLoading] = useState<boolean>(true);

  // useEffect(() => {
  //   if (!loading) {
  //     setLoading(true);
  //   }
  // }, [selectedWork]);

  const workLinks = [
    "Apple",
    "Zollege",
    "Elliot Smith Player",
    "Arboretum Creek",
  ];

  return (
    <WorkWrapper>
      <h1 className="WorkSectionTitle">/work</h1>
      <ContentWrapper>
        <WorkChips>
          {workLinks.map((work, idx) => {
            const selected = idx === selectedWork;
            return (
              <Chip
                key={`chip-${idx}`}
                selected={selected}
                content={work}
                customClickEvent={() => setSelectedWork(idx)}
              />
            );
          })}
        </WorkChips>
        <Divider style={{}} />
        <SelectedWorkContent
          selectedWork={workLinks[selectedWork]}
          workLinks={workLinks}
        ></SelectedWorkContent>
      </ContentWrapper>
      <CurveContainer>
        <svg
          data-name="Layer 1"
          xmlns="http://www.w3.org/2000/svg"
          viewBox="0 0 1200 120"
          preserveAspectRatio="none"
        >
          <path
            d="M321.39,56.44c58-10.79,114.16-30.13,172-41.86,82.39-16.72,168.19-17.73,250.45-.39C823.78,31,906.67,72,985.66,92.83c70.05,18.48,146.53,26.09,214.34,3V0H0V27.35A600.21,600.21,0,0,0,321.39,56.44Z"
            className="shape-fill"
          ></path>
        </svg>
      </CurveContainer>
    </WorkWrapper>
  );
};

export default Work;

const WorkWrapper = styled.div`
  padding-top: 150px;
  display: flex;
  flex-direction: column;
  width: 100%;
  min-height: 700px;
  position: relative;
  box-sizing: border-box;
  justify-content: center;
  align-items: center;
  background-color: #e0e3e7;
  .WorkSectionTitle {
    color: #121212 !important;
    font-size: 70px;
    margin: 0 0 75px 0px;
  }
`;

const ContentWrapper = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: row;
  margin-bottom: 250px;
  box-sizing: border-box;
  justify-content: center;
  column-gap: 25px;
  @media screen and (max-width: 1200px) {
    flex-direction: column;
    align-items: center;
    justify-content: center;
  }
`;

const WorkChips = styled(VerticalWrapper)`
  row-gap: 15px;
  padding-left: 5%;
  @media screen and (max-width: 1200px) {
    flex-direction: row;
    overflow-x: scroll;
    column-gap: 5px;
    button {
      margin-bottom: 10px;
    }
  }
`;

const Divider = styled.div`
  width: 0px;
  border: 1px solid #282828;
  border-radius: 3px;
`;

const CurveContainer = styled.div`
  display: none;
  position: absolute;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 101px;
  line-height: 0;
  box-sizing: border-box;

  svg {
    position: relative;
    bottom: -101px;
    display: block;
    width: calc(109% + 1.3px);
    height: 101px;
    z-index: 2;
    box-sizing: border-box;
  }

  .shape-fill {
    fill: #e0e3e7;
  }
`;

